{"cells":[{"source":"<a href=\"https://www.kaggle.com/mohamedaba/google-capstone-project-cyclistic-bike-share?scriptVersionId=86313302\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"7fdbf7c8","metadata":{"papermill":{"duration":0.028947,"end_time":"2022-01-27T14:00:13.455239","exception":false,"start_time":"2022-01-27T14:00:13.426292","status":"completed"},"tags":[]},"source":["## **Case Study**\n","### How Does a Bike-Share Navigate Speedy Success?\n","##### Three questions will guide the future marketing program:\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","#### **<span style=\"color:blue\">Prepare</span>**\n","A key observation about the dataset:\n","* It's primary data from the source with 13 columns.\n","* There are some missing data.\n","* The file organized per month\n","* The data need to be clean.\n","\n","#### **<span style=\"color:blue\">Process</span>**\n","* Convert the CSV to xlsx and archive the CSV files.\n","* Manipulate the data with SQL\n","* Make a unique table for the 12 months.\n","* Calculate the ride length and determine the days.\n","* Reduce the number of columns. and keep only ride_id, rideable_type, started_at, ended_at, ride_length, day_of_week and member_casual.\n","* Remove the raw the ride_length = 00:00:00.\n","* Delete ride id > 16. \n","* Delete duplicate.\n","\n","#### **<span style=\"color:blue\">Analyze</span>**\n","##### **Analyze with SQL**\n","* Average time of using\n","* Number of trips per hours\n","* Number of trips per day\n","* Number of trips per month\n","\n","#### **<span style=\"color:blue\">Share</span>**\n","\n","##### **Visualization with R**\n","**Uploading the library**"]},{"cell_type":"code","execution_count":1,"id":"9c3c7ea8","metadata":{"execution":{"iopub.execute_input":"2022-01-27T14:00:13.516029Z","iopub.status.busy":"2022-01-27T14:00:13.512403Z","iopub.status.idle":"2022-01-27T14:00:15.047232Z","shell.execute_reply":"2022-01-27T14:00:15.045158Z"},"papermill":{"duration":1.566438,"end_time":"2022-01-27T14:00:15.047431","exception":false,"start_time":"2022-01-27T14:00:13.480993","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘scales’\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    discard\n","\n","\n","The following object is masked from ‘package:readr’:\n","\n","    col_factor\n","\n","\n"]}],"source":["library (tidyverse)\n","library(readxl)\n","library(scales)"]},{"cell_type":"markdown","id":"c0f43df7","metadata":{"papermill":{"duration":0.030047,"end_time":"2022-01-27T14:00:15.107163","exception":false,"start_time":"2022-01-27T14:00:15.077116"