(\"number_of_ride_casual\", \"number_of_ride_member\"),labels=c(\"casual\", \"member\"))"]},{"cell_type":"markdown","id":"80b6bb04","metadata":{"papermill":{"duration":0.040288,"end_time":"2022-01-27T14:00:18.163177","exception":false,"start_time":"2022-01-27T14:00:18.122889","status":"completed"},"tags":[]},"source":["##### **Summary of the analyze**\n","\n","After the observation of different aspects of the dataset that on our hand, and considering the missing information that can be an obstacle to find a clear answer for our question that it's the objective for the case we can say:\n","\n","* Firstly, the people with casual membership use the service longer than subscribers do.\n","* We notice also that between 15h and 19h is the busy time for both membership (usually it's the after work or school time), and also that there's an augmentation of using the service by the subscriber in the morning (between 6h and 9h).\n","* The middle of the week (between Monday and Friday) the subscriber uses the bike more, but we see that the inverse for the casual membership is that we find high use in the weekend.\n","* The summer is the busy period of the year for both memberships, but we see a decrease mostly in the winter. So, we can see a correlation between the weather (the season of the year) and using the bike.\n","\n","#### **<span style=\"color:blue\">Act</span>**\n","##### **Recommendations that can get more cyclistic with annual memberships. **\n","1. Target the casual cyclistic that use the bike to go and back from work. *The busy time is between 6h and 9 in the morning and 15h and 19h in the afternoon.*.\n","2. Target also the casual cyclistic in the middle of the week, because we find a high using for member cyclistic, that maybe they're the future subscriber?\n","3. Do less marketing in the winter because of the bad weather, people use bikes less. and more of marketing in the ***spring*** and the ***summer*** and also the first months of the ***autumn***.\n","\n","\n","## **End of my case study**"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":8.277321,"end_time":"2022-01-27T14:00:18.317689","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-01-27T14:00:10.040368","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}